import React from 'react'

const App = () => {
    const userData = [
        {name: 'bravo', age: 40, email: 'bravo@com'},
        {name: 'ngidi', age: 35, email: 'ngidi@com'},
        {name: 'james', age: 55, email: 'james@com'}
    ]
    return(
        <ol>
{userData.map((items) => {
    return(
        <>
{items.name}
{items.age}
{items.email}
</>
    )
})
}
</ol>
    )
}

export default App
